		var StagS1 = [root.r1, root.r2, root.r3];
		var StagS2 = [root.b1, root.b2, root.b3];
		var StagS3 = [
		    root.drops.s1,
		    root.drops.s2,
		    root.drops.s3,
		    root.drops.s4,
		    root.drops.s5
		];
		var StagB3 = [
		    root.drops.b1,
		    root.drops.b2,
		    root.drops.b3,
		    root.drops.b4,
		    root.drops.b5
		];
		
		tl
		    .to(root.bgb1, 0.5, { alpha: 0, ease: "Power2.easeOut" }, "0")
		    .staggerFrom(StagS1, 1, { alpha: 0, scaleY: "-=0.5", ease: "Power3.easeOut" }, 0.1, "0")
		    .from(root.cloud, 0.8, { alpha: 0, scaleX: 0.85, scaleY: 0.85, ease: "Power2.easeOut" }, "0.2")
		    .staggerFrom(StagS2, 1.5, { alpha: 0, scaleX: 0.5, scaleY: 0.5, ease: "Power2.easeOut" }, 0.1, "0")
			.call(wiggleBerries, null, "0+=0")
		    .from(root.tx2, 0.8, { alpha: 0, y: "+=30", ease: "Power2.easeOut" }, "0.2")
		    .from(root.box, 1.2, { alpha: 0, x: "-=70", ease: "Power2.easeOut" }, "0.5")
		
		    .add("sc2", 3.5)
		
		    // 👉 ЗАПУСК ВЗРЫВА ПРИ КАЖДОМ ЦИКЛЕ
		    .call(startBerryAnimation, null, "sc2-=0.02")
		
		    .staggerTo(StagS1, 1, { alpha: 0, scaleX: 5, scaleY: 5, ease: "Power3.easeOut" }, 0.1, "sc2")
		    .staggerTo(StagS2, 1, { alpha: 0, scaleX: 3.5, scaleY: 3.5, ease: "Power3.easeOut" }, 0.1, "sc2")
		    .to(root.cloud, 1.3, {scaleX: 3, scaleY: 3, y: "-=140", ease: "Power2.easeOut" }, "sc2")
		    .to(root.cloud, 0.3, { alpha: 0, ease: "Power2.easeOut" }, "sc2+=0.8")
		    .to(root.b1, 1, { x: "+=170", y: "+=140", ease: "Power2.easeOut" }, "sc2")
		    .to(root.b2, 1, { x: "-=170", y: "+=10", ease: "Power2.easeOut" }, "sc2")
		    .to(root.b3, 1, { x: "+=40", y: "-=120", ease: "Power2.easeOut" }, "sc2")
		    .from(root.disc, 0.5, { alpha: 0, ease: "Power2.easeOut" }, "sc2+=0.5")
		    .from(root.bg2, 0.5, { alpha: 0, ease: "Power2.easeOut" }, "sc2")
		    .to(root.bg1, 0.5, { alpha: 0, ease: "Power2.easeOut" }, "sc2+=0.3")
		    .to(root.tx2, 0.5, { alpha: 0, ease: "Power2.easeOut" }, "sc2+=0.3")
		    .to(root.box, 1, { scaleX: 0.85, scaleY: 0.85, x: "+=85", y: "-=140", ease: "Power2.easeOut" }, "sc2+=0.3")
		    .from(root.tx1, 0.5, { alpha: 0, ease: "Power2.easeOut" }, "sc2+=0.3")
		    .from(root.but, 1.5, { alpha: 0, scaleX: 3, scaleY: 3, ease: "Elastic.easeOut"}, "sc2+=0.5")
		    .staggerFrom(StagS3, 1.5, {alpha:0, y: "-=160", ease: "Bounce.easeOut" }, 0.3, "sc2+=1")
		
		.staggerFrom(StagB3, 1.5, { alpha: 0, scaleX: 0, scaleY: 0, ease: "Bounce.easeOut" }, 0.3, "sc2+=1")
		
